import React from "react";


const Navbar = () => {
    return (
        <nav>
			<ul>
				<li><a href="index.html">Home</a></li>
				<li><a href="contact.html" target="_blank">Contact Info</a></li>
			</ul>

		</nav>
    )
}

export default Navbar
